import { createUseStyles } from 'react-jss';
var useSpacingStyles = createUseStyles({
    xxsmall: {
        padding: 2.5,
    },
    xsmall: {
        padding: 5,
    },
    small: {
        padding: 10,
    },
    medium: {
        padding: 15,
        background: 'red'
    },
    large: {
        padding: 20,
    },
    xlarge: {
        padding: 25,
    },
    xxlarge: {
        padding: 30,
    }
});
export { useSpacingStyles, };
